import React from 'react';
import PropTypes from 'prop-types';
import { makeStyles } from '@material-ui/core/styles';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Typography from '@material-ui/core/Typography';
import Box from '@material-ui/core/Box';
import { ThemeProvider, createMuiTheme } from '@material-ui/core/styles';
import aboutme from './images/aboutmeicon.png';


export default function AboutMe() {


    function TabPanel(props) {
        const { children, value, index, ...other } = props;

        return (
            <div
                role="tabpanel"
                hidden={value !== index}
                id={`vertical-tabpanel-${index}`}
                aria-labelledby={`vertical-tab-${index}`}
                {...other}
            >
                {value === index && (
                    <Box p={3}>
                        <Typography>{children}</Typography>
                    </Box>
                )}
            </div>
        );
    }

    TabPanel.propTypes = {
        children: PropTypes.node,
        index: PropTypes.any.isRequired,
        value: PropTypes.any.isRequired,
    };

    function a11yProps(index) {
        return {
            id: `vertical-tab-${index}`,
            'aria-controls': `vertical-tabpanel-${index}`,
        };
    }

    const theme = createMuiTheme({
        typography: {
            fontFamily: [
                'Share Tech Mono', 'monospace'
            ].join(','),
        },
    });

    const useStyles = makeStyles((theme) => ({
        root: {
            flexGrow: 1,
            backgroundColor: theme.palette.background.paper,
            display: 'flex',
            height: 240,

            fontFamily: "'Share Tech Mono', monospace"
        },
        tabs: {
            borderRight: `1px solid ${theme.palette.divider}`,
            fontFamily: "'Share Tech Mono', monospace"
        },
    }));

    function VerticalTabs() {
        const classes = useStyles();
        const [value, setValue] = React.useState(0);

        const handleChange = (event, newValue) => {
            setValue(newValue);
        };

        return (
            <ThemeProvider theme={theme}>
                <div className={classes.root}>
                    <Tabs
                        orientation="vertical"
                        variant="scrollable"
                        value={value}
                        onChange={handleChange}
                        aria-label="Vertical tabs example"
                        className={classes.tabs}
                    >
                        <Tab label="About Me" {...a11yProps(0)} />
                        <Tab label="Contact" {...a11yProps(1)} />
                        <Tab label="Item Three" {...a11yProps(2)} />

                    </Tabs>
                    <TabPanel value={value} index={0}>
                        This is my about me!!!
            </TabPanel>
                    <TabPanel value={value} index={1}>
                        Item Two
            </TabPanel>
                    <TabPanel value={value} index={2}>
                        Item Three
            </TabPanel>

                </div>
            </ThemeProvider>
        );
    }


    return (
        <div style={{ display: 'flex', justifyContent: 'center' }}>
            <div>
            <h1 style={{ display: 'flex', position: 'absolute', fontSize: '50px', alignItems: 'center', justifyContent: 'center', marginTop: '-80px'}}><img src={aboutme} className='image' style={{
                    height: '80px',
                    width: '80px',
                    padding: '20px'
                }} />ABOUT ME</h1>
            </div>
            <div><VerticalTabs /></div>
        </div>

    )
}
